:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  JLUDBROOK, Henry Samuel (Harry) and KINSELLA, Hana
  JLUDBROOK, Geoffrey Valentine and WHIBLEY, Lucy
  JLUDBROOK, Peter Henry Whibley and JONES, Margaret Hingston
  LUDBROOK, Peter Henry m on 07.01.1956 to (1) JONES, Margaret Hingston
  Whibley
  b 04.07.1928 d 23.09.1997
  b 15.11.1933
  Peter b. at Kawakawa and m. at St John the Baptist Church, Waimate North. Divorced 14.05.1985.
  Margaret, d/o William Duncan Jones and Verna Mabel Hingston, b. at Pakaraka. Margaret is a descendant,
  through her mother's family, of Captain Thomas Hansen of the "Active" and Captain William George
  Cornelius Hingston of the "Mary Anne".
  Peter was educated at King's School, King's College and Massey University. Margaret is a Karitane
  nurse.
  Refer to "The Hansens and the Kings" published by Evagean Publishing in 1991 for records of Margaret's
  family.
  01> LUDBROOK, Michael Geoffrey m on 12.02.1983 to (1) GATTI, Alice
  b 18.08.1957
  b 27.08.1961
  Michael b. at Kawakawa and m. at Waimate North. Divorced 1988. Alice, d/o John George Austin Gatti
  and Susan Booth, b. at Wellington.
  Michael was educated at King's College and Massey University. He is a farmer and sport horse
  breeder and trainer. Alice is a nurse.
  01> LUDBROOK, Michael Geoffrey m on 25.01.1992 to (2) LAWSON, Christine
  b 18.08.1957
  b 02.10.1961 d 30.04.1995
  Michael m. at Holy Trinity Church, Pakaraka. Christine, d/o Colin Leonard Dawson and Gloria Megan
  Higgs, b. at Christchurch. Address: "Everleigh Farm", Pakaraka, RD 2, Kaikohe.
  Michael is chairman of the Bay of Islands Pastoral and Industrial Association and, as such, is
  involved in preparations for celebrating the 150th anniversary of the show.
  01> LUDBROOK, Michael Geoffrey and (3) SKINNER, Laura
  Margaret Gwendolyn
  b 18.08.1957
  b 26.06.1976
  Laura b. at Kerikeri.
  02> LUDBROOK, Andrew Duncan m on 22.03.1997 to ATCHISON, Suzanne Joy
  b 18.02.1959.
  b 12.01.1963
  Andrew b. at Kawakawa. Address: Pakaraka, RD 2, Kaikohe.
  Andrew was educated at King's College and is a sheep and beef farmer, owning part of OLC 54,
  "Ngaheia".
  03> LUDBROOK, Deborah Ann m on 16.03.1991 to WHITE, Spencer Allan
  b 07.05.1962
  b 25.09.1957
  Deborah b, at Kawakawa and m, at Pakaraka. Spencer, s/o John Ferguson White and Patricia
  Fairbrother, b. at Auckland. Address: Pakaraka, RD 2, Kaikohe.
  Deborah was educated at Auckland Diocesan School and Otago University (DipHomeSc). She owned a
  restaurant and is now helping Spencer with their small holding and involved in nutrition education.
  Spencer was educated at St Kentigern's College and was an urban valuer. He is now involved in
  farming and horticulture on their small farm block, a part of the "Pouerua" property.
